description:
The second season of Stargate Universe was announced by Syfy on December 13, 2009. Like the first season, the second season will consist of 20 episodes.Nine episodes have already been reserved by the primary series writers. The series was moved from the franchise's usual time on Friday to Tuesday, along with Caprica. This is due to Syfy picking up WWE Friday Night SmackDown.The series resumed on September 28, 2010, USA. In Ireland &amp; UK the series resumed on October 5 at 9pm on Sky1 and Sky1 HD.

